  \"international-geophysical-year-1957-1958-drifting-station-alpha-documentary-film-6566f\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This film documents the activities that
  occurred on Drifting Station Alpha in the Arctic Ocean during the International
  Geophysical Year, 1957 to 1958. The film is narrated by project leader, Norbert
  Untersteiner, and chronicles the life of the team as they built their camp and set
  up experiments. Station Alpha was the first long-term scientific base on arctic
  pack ice operated by a Western country. At the time of its establishment, Russia
  had already operated six drifting ice camps of this kind. However, due to the strategic
  importance and sensitivity of the Arctic Basin, little information from these early
  stations had reached the West. The documentary was filmed and produced by Frans
  van der Hoeven (Senior Scientist at Station Alpha) and Norbert Untersteiner (Scientific
  Leader of Station Alpha). Station Alpha drifted in an area of the Arctic ocean located
  500 km north of Barrow, Alaska USA from April 1957 to November 1958; the film covers
  this entire time period. Digitized copies of the film are available on DVD.\",\n\t\"license_title\":
